void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = (fragCoord * 2.0 - iResolution.xy) / iResolution.y;
    uv = fract(uv * 1.5) - 0.5;

    float d = length(uv);

    d = sin(d*32.0 + iTime)/32.0;
    d = abs(d);
    d = pow(0.01 / d, 2.0);

    vec3 col = vec3(d);

    // Output to screen
    fragColor = vec4(col,1.0);
}
